const url = 'https://api.covid19india.org/state_district_wise.json'

export const fetchData = async () => {
    try {
        const response = await (await fetch(url)).json();
        const modifiedData = {
            assam: [...response['Assam']['districtData']]
        }
        return modifiedData
    } catch (error) {

    }
}
